{"payload":{"allShortcutsEnabled":true,"fileTree":{"":{"items":[{"name":"CloudFront.md","path":"CloudFront.md","contentType":"file"},{"name":"LICENSE","path":"LICENSE","contentType":"file"},{"name":"README.md","path":"README.md","contentType":"file"},{"name":"README_CN.md","path":"README_CN.md","contentType":"file"},{"name":"XrayR.service","path":"XrayR.service","contentType":"file"},{"name":"XrayR.sh","path":"XrayR.sh","contentType":"file"},{"name":"config.yml","path":"config.yml","contentType":"file"},{"name":"install-0.8.0.sh","path":"install-0.8.0.sh","contentType":"file"},{"name":"install.sh","path":"install.sh","contentType":"file"}],"totalCount":9}},"fileTreeProcessingTime":3.389308,"foldersToFetch":[],"reducedMotionEnabled":"system","repo":{"id":372377237,"defaultBranch":"main","name":"XrayR-V2Board","ownerLogin":"missuo","currentUserCanPush":false,"isFork":false,"isEmpty":false,"createdAt":"2021-05-31T12:00:52.000+08:00","ownerAvatar":"https://avatars.githubusercontent.com/u/55200481?v=4","public":true,"private":false,"isOrgOwned":false},"refInfo":{"name":"main","listCacheKey":"v0:1651142864.416651","canEdit":true,"refType":"branch","currentOid":"8da3986b0d4dbd6dc52c4bb3c82e2b45d7937bba"},"path":"XrayR.sh","currentUser":{"id":83809537,"login":"linbaoping","userEmail":"1804605308@qq.com"},"blob":{"rawBlob":"#!/bin/bash\n\nred='\\033[0;31m'\ngreen='\\033[0;32m'\nyellow='\\033[0;33m'\nplain='\\033[0m'\n\nversion=\"v1.0.0\"\n\n# check root\n[[ $EUID -ne 0 ]] && echo -e \"${red}错误: ${plain} 必须使用root用户运行此脚本！\\n\" && exit 1\n\n# check os\nif [[ -f /etc/redhat-release ]]; then\n    release=\"centos\"\nelif cat /etc/issue | grep -Eqi \"debian\"; then\n    release=\"debian\"\nelif cat /etc/issue | grep -Eqi \"ubuntu\"; then\n    release=\"ubuntu\"\nelif cat /etc/issue | grep -Eqi \"centos|red hat|redhat\"; then\n    release=\"centos\"\nelif cat /proc/version | grep -Eqi \"debian\"; then\n    release=\"debian\"\nelif cat /proc/version | grep -Eqi \"ubuntu\"; then\n    release=\"ubuntu\"\nelif cat /proc/version | grep -Eqi \"centos|red hat|redhat\"; then\n    release=\"centos\"\nelse\n    echo -e \"${red}未检测到系统版本，请联系脚本作者！!${plain}\\n\" && exit 1\nfi\n\nos_version=\"\"\n\n# os version\nif [[ -f /etc/os-release ]]; then\n    os_version=$(awk -F'[= .\"]' '/VERSION_ID/{print $3}' /etc/os-release)\nfi\nif [[ -z \"$os_version\" && -f /etc/lsb-release ]]; then\n    os_version=$(awk -F'[= .\"]+' '/DISTRIB_RELEASE/{print $2}' /etc/lsb-release)\nfi\n\nif [[ x\"${release}\" == x\"centos\" ]]; then\n    if [[ ${os_version} -le 6 ]]; then\n        echo -e \"${red}请使用 CentOS 7 或更高版本的系统！${plain}\\n\" && exit 1\n    fi\nelif [[ x\"${release}\" == x\"ubuntu\" ]]; then\n    if [[ ${os_version} -lt 16 ]]; then\n        echo -e \"${red}请使用 Ubuntu 16 或更高版本的系统！${plain}\\n\" && exit 1\n    fi\nelif [[ x\"${release}\" == x\"debian\" ]]; then\n    if [[ ${os_version} -lt 8 ]]; then\n        echo -e \"${red}请使用 Debian 8 或更高版本的系统！${plain}\\n\" && exit 1\n    fi\nfi\n\nconfirm() {\n    if [[ $# > 1 ]]; then\n        echo && read -p \"$1 [默认$2]: \" temp\n        if [[ x\"${temp}\" == x\"\" ]]; then\n            temp=$2\n        fi\n    else\n        read -p \"$1 [y/n]: \" temp\n    fi\n    if [[ x\"${temp}\" == x\"y\" || x\"${temp}\" == x\"Y\" ]]; then\n        return 0\n    else\n        return 1\n    fi\n}\n\nconfirm_restart() {\n    confirm \"是否重启XrayR\" \"y\"\n    if [[ $? == 0 ]]; then\n        restart\n    else\n        show_menu\n    fi\n}\n\nbefore_show_menu() {\n    echo && echo -n -e \"${yellow}按回车返回主菜单: ${plain}\" && read temp\n    show_menu\n}\n\ninstall() {\n    bash <(curl -Ls https://raw.githubusercontent.com/missuo/XrayR-V2Board/master/install.sh)\n    if [[ $? == 0 ]]; then\n        if [[ $# == 0 ]]; then\n            start\n        else\n            start 0\n        fi\n    fi\n}\n\nupdate() {\n    if [[ $# == 0 ]]; then\n        echo && echo -n -e \"输入指定版本(默认最新版): \" && read version\n    else\n        version=$2\n    fi\n#    confirm \"本功能会强制重装当前最新版，数据不会丢失，是否继续?\" \"n\"\n#    if [[ $? != 0 ]]; then\n#        echo -e \"${red}已取消${plain}\"\n#        if [[ $1 != 0 ]]; then\n#            before_show_menu\n#        fi\n#        return 0\n#    fi\n    bash <(curl -Ls https://raw.githubusercontent.com/missuo/XrayR-V2Board/master/install.sh) $version\n    if [[ $? == 0 ]]; then\n        echo -e \"${green}更新完成，已自动重启 XrayR，请使用 XrayR log 查看运行日志${plain}\"\n        exit\n    fi\n\n    if [[ $# == 0 ]]; then\n        before_show_menu\n    fi\n}\n\nconfig() {\n    echo \"XrayR在修改配置后会自动尝试重启\"\n    vi /etc/XrayR/config.yml\n    sleep 2\n    check_status\n    case $? in\n        0)\n            echo -e \"XrayR状态: ${green}已运行${plain}\"\n            ;;\n        1)\n            echo -e \"检测到您未启动XrayR或XrayR自动重启失败，是否查看日志？[Y/n]\" && echo\n            read -e -p \"(默认: y):\" yn\n            [[ -z ${yn} ]] && yn=\"y\"\n            if [[ ${yn} == [Yy] ]]; then\n               show_log\n            fi\n            ;;\n        2)\n            echo -e \"XrayR状态: ${red}未安装${plain}\"\n    esac\n}\n\nuninstall() {\n    confirm \"确定要卸载 XrayR 吗?\" \"n\"\n    if [[ $? != 0 ]]; then\n        if [[ $# == 0 ]]; then\n            show_menu\n        fi\n        return 0\n    fi\n    systemctl stop XrayR\n    systemctl disable XrayR\n    rm /etc/systemd/system/XrayR.service -f\n    systemctl daemon-reload\n    systemctl reset-failed\n    rm /etc/XrayR/ -rf\n    rm /usr/local/XrayR/ -rf\n\n    echo \"\"\n    echo -e \"卸载成功，如果你想删除此脚本，则退出脚本后运行 ${green}rm /usr/bin/XrayR -f${plain} 进行删除\"\n    echo \"\"\n\n    if [[ $# == 0 ]]; then\n        before_show_menu\n    fi\n}\n\nstart() {\n    check_status\n    if [[ $? == 0 ]]; then\n        echo \"\"\n        echo -e \"${green}XrayR已运行，无需再次启动，如需重启请选择重启${plain}\"\n    else\n        systemctl start XrayR\n        sleep 2\n        check_status\n        if [[ $? == 0 ]]; then\n            echo -e \"${green}XrayR 启动成功，请使用 XrayR log 查看运行日志${plain}\"\n        else\n            echo -e \"${red}XrayR可能启动失败，请稍后使用 XrayR log 查看日志信息${plain}\"\n        fi\n    fi\n\n    if [[ $# == 0 ]]; then\n        before_show_menu\n    fi\n}\n\nstop() {\n    systemctl stop XrayR\n    sleep 2\n    check_status\n    if [[ $? == 1 ]]; then\n        echo -e \"${green}XrayR 停止成功${plain}\"\n    else\n        echo -e \"${red}XrayR停止失败，可能是因为停止时间超过了两秒，请稍后查看日志信息${plain}\"\n    fi\n\n    if [[ $# == 0 ]]; then\n        before_show_menu\n    fi\n}\n\nrestart() {\n    systemctl restart XrayR\n    sleep 2\n    check_status\n    if [[ $? == 0 ]]; then\n        echo -e \"${green}XrayR 重启成功，请使用 XrayR log 查看运行日志${plain}\"\n    else\n        echo -e \"${red}XrayR可能启动失败，请稍后使用 XrayR log 查看日志信息${plain}\"\n    fi\n    if [[ $# == 0 ]]; then\n        before_show_menu\n    fi\n}\n\nstatus() {\n    systemctl status XrayR --no-pager -l\n    if [[ $# == 0 ]]; then\n        before_show_menu\n    fi\n}\n\nenable() {\n    systemctl enable XrayR\n    if [[ $? == 0 ]]; then\n        echo -e \"${green}XrayR 设置开机自启成功${plain}\"\n    else\n        echo -e \"${red}XrayR 设置开机自启失败${plain}\"\n    fi\n\n    if [[ $# == 0 ]]; then\n        before_show_menu\n    fi\n}\n\ndisable() {\n    systemctl disable XrayR\n    if [[ $? == 0 ]]; then\n        echo -e \"${green}XrayR 取消开机自启成功${plain}\"\n    else\n        echo -e \"${red}XrayR 取消开机自启失败${plain}\"\n    fi\n\n    if [[ $# == 0 ]]; then\n        before_show_menu\n    fi\n}\n\nshow_log() {\n    journalctl -u XrayR.service -e --no-pager -f\n    if [[ $# == 0 ]]; then\n        before_show_menu\n    fi\n}\n\ninstall_bbr() {\n    bash <(curl -L -s https://raw.githubusercontent.com/chiakge/Linux-NetSpeed/master/tcp.sh)\n    #if [[ $? == 0 ]]; then\n    #    echo \"\"\n    #    echo -e \"${green}安装 bbr 成功，请重启服务器${plain}\"\n    #else\n    #    echo \"\"\n    #    echo -e \"${red}下载 bbr 安装脚本失败，请检查本机能否连接 Github${plain}\"\n    #fi\n\n    #before_show_menu\n}\n\nupdate_shell() {\n    wget -O /usr/bin/XrayR -N --no-check-certificate https://raw.githubusercontent.com/missuo/XrayR-V2Board/master/XrayR.sh\n    if [[ $? != 0 ]]; then\n        echo \"\"\n        echo -e \"${red}下载脚本失败，请检查本机能否连接 Github${plain}\"\n        before_show_menu\n    else\n        chmod +x /usr/bin/XrayR\n        echo -e \"${green}升级脚本成功，请重新运行脚本${plain}\" && exit 0\n    fi\n}\n\n# 0: running, 1: not running, 2: not installed\ncheck_status() {\n    if [[ ! -f /etc/systemd/system/XrayR.service ]]; then\n        return 2\n    fi\n    temp=$(systemctl status XrayR | grep Active | awk '{print $3}' | cut -d \"(\" -f2 | cut -d \")\" -f1)\n    if [[ x\"${temp}\" == x\"running\" ]]; then\n        return 0\n    else\n        return 1\n    fi\n}\n\ncheck_enabled() {\n    temp=$(systemctl is-enabled XrayR)\n    if [[ x\"${temp}\" == x\"enabled\" ]]; then\n        return 0\n    else\n        return 1;\n    fi\n}\n\ncheck_uninstall() {\n    check_status\n    if [[ $? != 2 ]]; then\n        echo \"\"\n        echo -e \"${red}XrayR已安装，请不要重复安装${plain}\"\n        if [[ $# == 0 ]]; then\n            before_show_menu\n        fi\n        return 1\n    else\n        return 0\n    fi\n}\n\ncheck_install() {\n    check_status\n    if [[ $? == 2 ]]; then\n        echo \"\"\n        echo -e \"${red}请先安装XrayR${plain}\"\n        if [[ $# == 0 ]]; then\n            before_show_menu\n        fi\n        return 1\n    else\n        return 0\n    fi\n}\n\nshow_status() {\n    check_status\n    case $? in\n        0)\n            echo -e \"XrayR状态: ${green}已运行${plain}\"\n            show_enable_status\n            ;;\n        1)\n            echo -e \"XrayR状态: ${yellow}未运行${plain}\"\n            show_enable_status\n            ;;\n        2)\n            echo -e \"XrayR状态: ${red}未安装${plain}\"\n    esac\n}\n\nshow_enable_status() {\n    check_enabled\n    if [[ $? == 0 ]]; then\n        echo -e \"是否开机自启: ${green}是${plain}\"\n    else\n        echo -e \"是否开机自启: ${red}否${plain}\"\n    fi\n}\n\nshow_XrayR_version() {\n    echo -n \"XrayR 版本：\"\n    /usr/local/XrayR/XrayR -version\n    echo \"\"\n    if [[ $# == 0 ]]; then\n        before_show_menu\n    fi\n}\n\nshow_usage() {\n    echo \"XrayR 管理脚本使用方法: \"\n    echo \"------------------------------------------\"\n    echo \"XrayR              - 显示管理菜单 (功能更多)\"\n    echo \"XrayR start        - 启动 XrayR\"\n    echo \"XrayR stop         - 停止 XrayR\"\n    echo \"XrayR restart      - 重启 XrayR\"\n    echo \"XrayR status       - 查看 XrayR 状态\"\n    echo \"XrayR enable       - 设置 XrayR 开机自启\"\n    echo \"XrayR disable      - 取消 XrayR 开机自启\"\n    echo \"XrayR log          - 查看 XrayR 日志\"\n    echo \"XrayR update       - 更新 XrayR\"\n    echo \"XrayR update x.x.x - 更新 XrayR 指定版本\"\n    echo \"XrayR install      - 安装 XrayR\"\n    echo \"XrayR uninstall    - 卸载 XrayR\"\n    echo \"XrayR version      - 查看 XrayR 版本\"\n    echo \"------------------------------------------\"\n}\n\nshow_menu() {\n    echo -e \"\n  ${green}XrayR 后端管理脚本，${plain}${red}不适用于docker${plain}\n--- https://github.com/missuo/XrayR-V2Board ---\n  ${green}0.${plain} 修改配置\n————————————————\n  ${green}1.${plain} 安装 XrayR\n  ${green}2.${plain} 更新 XrayR\n  ${green}3.${plain} 卸载 XrayR\n————————————————\n  ${green}4.${plain} 启动 XrayR\n  ${green}5.${plain} 停止 XrayR\n  ${green}6.${plain} 重启 XrayR\n  ${green}7.${plain} 查看 XrayR 状态\n  ${green}8.${plain} 查看 XrayR 日志\n————————————————\n  ${green}9.${plain} 设置 XrayR 开机自启\n ${green}10.${plain} 取消 XrayR 开机自启\n————————————————\n ${green}11.${plain} 一键安装 bbr (最新内核)\n ${green}12.${plain} 查看 XrayR 版本 \n ${green}13.${plain} 升级维护脚本\n \"\n #后续更新可加入上方字符串中\n    show_status\n    echo && read -p \"请输入选择 [0-13]: \" num\n\n    case \"${num}\" in\n        0) config\n        ;;\n        1) check_uninstall && install\n        ;;\n        2) check_install && update\n        ;;\n        3) check_install && uninstall\n        ;;\n        4) check_install && start\n        ;;\n        5) check_install && stop\n        ;;\n        6) check_install && restart\n        ;;\n        7) check_install && status\n        ;;\n        8) check_install && show_log\n        ;;\n        9) check_install && enable\n        ;;\n        10) check_install && disable\n        ;;\n        11) install_bbr\n        ;;\n        12) check_install && show_XrayR_version\n        ;;\n        13) update_shell\n        ;;\n        *) echo -e \"${red}请输入正确的数字 [0-12]${plain}\"\n        ;;\n    esac\n}\n\n\nif [[ $# > 0 ]]; then\n    case $1 in\n        \"start\") check_install 0 && start 0\n        ;;\n        \"stop\") check_install 0 && stop 0\n        ;;\n        \"restart\") check_install 0 && restart 0\n        ;;\n        \"status\") check_install 0 && status 0\n        ;;\n        \"enable\") check_install 0 && enable 0\n        ;;\n        \"disable\") check_install 0 && disable 0\n        ;;\n        \"log\") check_install 0 && show_log 0\n        ;;\n        \"update\") check_install 0 && update 0 $2\n        ;;\n        \"config\") config $*\n        ;;\n        \"install\") check_uninstall 0 && install 0\n        ;;\n        \"uninstall\") check_install 0 && uninstall 0\n        ;;\n        \"version\") check_install 0 && show_XrayR_version 0\n        ;;\n        \"update_shell\") update_shell\n        ;;\n        *) show_usage\n    esac\nelse\n    show_menu\nfi\n","colorizedLines":null,"stylingDirectives":[[{"start":0,"end":11,"cssClass":"pl-c"},{"start":0,"end":2,"cssClass":"pl-c"}],[],[{"start":4,"end":16,"cssClass":"pl-s"},{"start":4,"end":5,"cssClass":"pl-pds"},{"start":15,"end":16,"cssClass":"pl-pds"}],[{"start":6,"end":18,"cssClass":"pl-s"},{"start":6,"end":7,"cssClass":"pl-pds"},{"start":17,"end":18,"cssClass":"pl-pds"}],[{"start":7,"end":19,"cssClass":"pl-s"},{"start":7,"end":8,"cssClass":"pl-pds"},{"start":18,"end":19,"cssClass":"pl-pds"}],[{"start":6,"end":15,"cssClass":"pl-s"},{"start":6,"end":7,"cssClass":"pl-pds"},{"start":14,"end":15,"cssClass":"pl-pds"}],[],[{"start":8,"end":16,"cssClass":"pl-s"},{"start":8,"end":9,"cssClass":"pl-pds"},{"start":15,"end":16,"cssClass":"pl-pds"}],[],[{"start":0,"end":12,"cssClass":"pl-c"},{"start